import React from 'react'

export const RegisterPage = () => {
  return (
    <div className="register">
      <div className="register__header">
        <h2 className="j-title">Register</h2>
        <img src="../assets/logo.svg" alt="Journal-logo" />
      </div>
    </div>
  )
}
